import React from 'react';
import { primaryOrange, secondaryYellow, darkGray, white } from './colors';

function Header() {
    return (
        <header style={{
            backgroundColor: primaryOrange,
            padding: '20px',
            textAlign: 'center',
            color: white,
            boxShadow: '0 2px 5px rgba(0,0,0,0.2)'
        }}>
            <h1>Synthèse Pré-Déclassement</h1>
            
        </header>
    );
}

export default Header;
